import React from 'react'
import { useNavigate } from 'react-router-dom';
import NavigateToLink from './NavigateToLink';

const register = "register";
const login = "login";
const menu = "menu";

// function NavigateToHome(){
//     const navigate = useNavigate();

//     navigate("/");
// }

// function NavigateToLink(denumire){
//     const navigate = useNavigate();

//     navigate("/" + denumire);
// }

function Navbar2() {
    const navigate = useNavigate();

    return (
        <div className='navbar'>
            <div className='containerNavbarButtons'>
                <button className="navbarButtons" id="menuAbout" onClick={() => {navigate("/")}}>About</button>
                <button className="navbarButtons" id="menuRegister" onClick={() => {navigate("/register")}}>Register</button>
                <button className="navbarButtons" id="loginMenu">Login</button>
                <button className="navbarButtons" id="menu">Menu</button>
            </div>
        </div>
    )
}

export default Navbar2;
